export default function RenderHomeMovies({movies}) {
// console.log(movies[2].title);
    return(
        <>
  
        {movies && (
          <ul>
            {movies.map(movie => (
              <li key={movie.id}>
                  <h2>{movie.title}</h2>
                <img src={`https://image.tmdb.org/t/p/w500${movie.poster_path}`} al/>
              </li>
            ))}
          </ul>
        )}
      </>

    )
 
}

